import React, { useState, useCallback } from 'react';
import { useHistory } from 'react-router-dom';
import './fonts/rsufont/RSU_Regular.ttf'
import './fonts/rsufont/RSU_light.ttf'
import './fonts/rsufont/RSU_BOLD.ttf'
import './modules/css/App.css';
import MyNavbar from './modules/components/navbar/MyNavbar.js';
import Home from './modules/pages/Home.js';
import Setting from './modules/pages/Setting';
import Login from './modules/pages/Login';
import Profile from './modules/pages/Profile';
// import Routes from "./modules/router/Routes.js";

function App() {

  // const routeResult = useRoutes(Routes)
  const [theme, setTheme] = useState('theme_dark');
  const [navbarTheme, setNavbarTheme] = useState('dark');

  const handleNavbarThemeChange = useCallback((current_theme) => {
    setNavbarTheme(current_theme);
    setTheme('theme_'+current_theme);
  },[setNavbarTheme,setTheme]);

  return (
    <div className={"App "+theme}>
      <MyNavbar theme={navbarTheme} onChangeTheme={handleNavbarThemeChange}></MyNavbar>
      {/* {routeResult} */}

      <main>
        <Route path="/">
          <Home theme={theme} handleThemeChange={handleNavbarThemeChange}></Home>
        </Route>
        <Route path="/help">
          <Help theme={theme} handleThemeChange={handleNavbarThemeChange}></Help>
        </Route>
        <Route path="/setting">
          <Setting theme={theme} handleThemeChange={handleNavbarThemeChange}></Setting>
        </Route>
        <Route path="/profile">
          <Profile theme={theme} handleThemeChange={handleNavbarThemeChange}></Profile>
        </Route>
        <Route path="/login">
          <Login theme={theme} handleThemeChange={handleNavbarThemeChange}></Login>
        </Route>
      </main>


    </div>
  );
}

export default App;
